import React from "react";
import "./Education.css";

const Education = () => {
  return <div className="eduContainer">
    <div className="degree">
      B.Tech
    </div>
    <div className="inter">
      12th
    </div>
    <div className="ssc">
    10th
    </div>
    </div>;
};

export default Education;
